// Footer.js

import React from 'react';
import './style.css';

const Footer = () => {
  return (
    <footer className="footer-container">

      <div className="footer-info">
        <div className="footer-section">
          <h4 className="footer-section-title">회사 정보</h4>
          <p>보리전자 주식회사 대표이사:이은지 | 사업자등록번호:000-00-00000 | OO판매업 신고:0000-서울마포-0000</p>
          <p>사업장 주소: 서울특별시 00구 00동 00, 000호(연남동) | 호스팅서비스사업자: 한국아이비엠(주) | 대표번호:00-0000-0000 | 제품/서비스/멤버십:0000-0000(통화요금:발신자부담) | 구매문의:0000-0000 | e식품관 문의:0000-0000</p>
        </div>
      </div>

      <p className="footer-disclaimer">
        본 사이트는 포트폴리오로 사용됩니다. 상업적인 목적이나 저작물의 판매, 배포 등을 포함하지 않기 때문에 저작권법에 대한 문제는 발생하지 않습니다.
      </p>
      <p className="footer-disclaimer">
        디자인 및 기능은 (주)삼성전자 사이트를 참고하여 개발되었습니다.
      </p>
      <p className="footer-small">
       React 라이브러리 기반으로 만들어진 포트폴리오 입니다.
      </p>
    </footer>
  );
};

export default Footer;
